import "./Cart.css";

import CartItem from "../components/CartItem";

const Cart = () => {
  return (
    <div className="cart">
      <div className="cart-left">
        <h2>Carro de compras</h2>
        <CartItem />
      </div>
      <div className="cart-right">
        <div className="cart-info">
          <p>Subtotal (0) item </p>
          <p>Precio : $499.99</p>
        </div>
        <div>
          <button>Realizar compra</button>
        </div>
      </div>
    </div>
  );
};

export default Cart;
